import{_ as a,o as e,c as i,e as t}from"./chunks/framework.nzJD8CNM.js";const l="/assets/alexey-veselovskiy.8CFXl5XI.png",h=JSON.parse('{"title":"ПиранезиLAB","description":"Лаборатория экспериментальной печати","frontmatter":{"title":"ПиранезиLAB","description":"Лаборатория экспериментальной печати","date":"2016-03-16","icon":"logo.jpg","cover":"cover.jpg","url":"https://www.piranesilab.ru","address":"Переведеновский пер., д. 18, стр. 2","place":"ЦТИ Фабрика","city":"г. Москва","coord":[55.779616721139675,37.69016647186852],"facebook":"piranesilab","instagram":"piranesilab","vk":"piranesilab","status":"open"},"headers":[],"relativePath":"workshop/catalog/piranezi-lab/index.md","filePath":"workshop/catalog/piranezi-lab/index.md"}'),r={name:"workshop/catalog/piranezi-lab/index.md"},o=t('<ul><li>Площадка для профессионалов и поклонников художественной ручной печати.</li><li>Платформа для обучения и экспериментов в области печати, дизайна и других креативных практик.</li><li>Выставочное пространство и место для печатных коллабораций.</li></ul><hr><ul><li>Хотите что-то напечатать для себя и для других? Место и материалы предоставим.</li><li>Интересуетесь различными способами печати и мечтаете попробовать? Научим.</li><li>Считаете, что печать это не только технологии, но и художественный инструмент? Ждем вас в ПиранезиLAB!</li></ul><p>Площадка для профессионалов и поклонников печати. Платформа для обучения и экспериментов в области печати, дизайна и других креативных практик. Свободные мастерские с оборудованием, доступным для всех. Выставочное пространство и место для печатных коллабораций.</p><h2 id="основные-направления-деятельности-лаборатории-экспериментальнои-печати-пиранезиlab" tabindex="-1">Основные направления деятельности Лаборатории экспериментальной печати ПиранезиLAB <a class="header-anchor" href="#основные-направления-деятельности-лаборатории-экспериментальнои-печати-пиранезиlab" aria-label="Permalink to &quot;Основные направления деятельности Лаборатории экспериментальной печати ПиранезиLAB&quot;">​</a></h2><p><strong>1. Открытые печатные мастерские.</strong> Место, где каждый может напечатать все, что ему нужно, своими руками. Самостоятельно или при поддержке консультантов. Мы предоставляем: – оборудованные профессиональные зоны для трафаретной печати (шелкографии УФ и водяные краски), высокой печати (тигельный пресс и офортные станки), офорта и акватинты; ручной фотопечати. – возможность изготовления высококачественные распечаток на широкоформатных фотопринтерах – оборудование для изготовления различных видов ручного переплета. Материалы можно принести с собой или приобрести их на месте. Работа с ресурсами лаборатории оплачивается по часам. Для членов клуба друзей существует возможность работать в лаборатории бесплатно в обмен на помощь и участие в деятельности лаборатории.</p><p><strong>2. Профессиональные услуги печати.</strong> Коммерческая печать художественной малотиражной продукции. От принтов до художественной сувенирной продукции. Наши основные заказчики и партнеры: художники, галереи, музеи; культурные и образовательные институции. Возможность коллаборативный печати: совместная работа художника и мастера-печатника, реализующих свои творческие замыслы в разнообразных графических техниках.</p><p><strong>3. Образовательный проект.</strong> Проведение мастер-классов, семинаров и практических занятий с приглашенными преподавателями и резидентами лаборатории. Темы мастер-классов связаны с печатными, издательскими и художественными процессами.</p><p><strong>4. Выставочная деятельность, проведение праздников и презентаций.</strong> В пространстве лаборатории раз в две недели проводятся выставки художников различных направлений и возрастов, занимающихся печатной графикой и фотографией. В планах лаборатории – проводя регулярные праздники, вечеринки и гулянки, превратить площадку в место общения единомышленников. Диапазон мероприятий широк: от танцев до показов кино. Из наших последних событий: – выставка Евгения Добровинского «Моя семья» (ссылка или фото). – Дизайн-карнавал,организованный Александром Васиным (ссылка или фото)</p><p><strong>5. Издательский проект.</strong> Подготовка собственных тематических предметных изданий по графике, печатным процессам и смежным областям. Издание каталогов всех проводимых в лаборатории выставок. Подготовка печатных изданий на заказ, в особенности изданий, в издании которых могут быть полезны компетенции резидентов и друзей лаборатории.</p><p><strong>6. Онлайн-курсы по графическим технологиям.</strong> – систематизация и составление открытой базы знаний по печатным технологиям – подготовка фото- и видеоматериалов – расшифровка и публикация отчетов и видео мастер-классов – изготовление и продажа наборов DIY для ручной печати.</p><h3 id="возможности-и-оборудование" tabindex="-1">Возможности и оборудование <a class="header-anchor" href="#возможности-и-оборудование" aria-label="Permalink to &quot;Возможности и оборудование&quot;">​</a></h3><ul><li>Шелкография. Полуавтоматические станки для трафаретной печати (1000х700мм) УФ, сольвентные и водные краски</li><li>Глубокая печать. Офортные станки (талер 2500х800мм). Классический офорт и современные техники</li><li>Фотогравюра (фотоофорт) на основе фотополимерной технологии</li><li>Фотолаборатория с оборудованием для ручной фотопечати и альтернативной фотографии</li><li>Цифровая широкоформатная печать на различных носителях</li><li>Оборудование для изготовления различных видов ручного переплета</li></ul><p><a href="https://moskvichmag.ru/lyudi/%D1%8D%D1%82%D0%BE-%D0%BC%D0%BE%D0%B9-%D0%B3%D0%BE%D1%80%D0%BE%D0%B4-%D0%BE%D1%81%D0%BD%D0%BE%D0%B2%D0%B0%D1%82%D0%B5%D0%BB%D1%8C-%D0%BB%D0%B0%D0%B1%D0%BE%D1%80%D0%B0%D1%82%D0%BE%D1%80%D0%B8%D0%B8/" class="external-link" target="_blank" rel="noreferrer">Статья о Пиранези Лаб от основателя проекта Алексея Веселовского</a></p><p><img src="'+l+'" alt="Алексей Веселовский"></p>',15),s=[o];function n(p,c,D,B,_,d){return e(),i("div",null,s)}const u=a(r,[["render",n]]);export{h as __pageData,u as default};
